if (!$("Find Itens").isExecuted) 
  return [{}];


const items = $("Find Itens")
  .all()
  .filter(item => !!item.json?._id);

if (items.length === 0) 
  return [{}];


const objIdExprs = items.map(item => ({
  $toObjectId: item.json._id
}));

return [
  {
    json: {
      query: {
        $expr: {
          $in: [
            "$_id",
            objIdExprs
          ]
        }
      }
    }
  }
];
